import './App.css';
import data from './data/Wine-Data.json'

function App() {
  const alcoholList = data.reduce((result,alcohol)=>{
    const alcoholClass = alcohol.Alcohol
    if(!result[alcoholClass]){
      result[alcoholClass] =[]
    }
    result[alcoholClass].push(alcohol)
    return result
  },{})
  //console.log(alcoholList)


  return (
    <div className="App">
      <h1>Wine Data</h1>
      <table>
        <thead>
            <tr>
              <th>Measure</th>
              {Object.keys(alcoholList).map((key)=><th>Class {key}</th>)}
            </tr>
        </thead>
        <tbody>
            <tr>
              <td>Mean</td>
              {Object.keys(alcoholList).map((key, index)=><td>{getMean(key,index)}</td>)}
            </tr>
            <tr>
              <td>Median</td>
            </tr>
            <tr>
              <td>Mode</td>
            </tr>
        </tbody>
      </table>
    </div>
  );
}

export default App;
